import React from 'react';
import './BreakPage.css';

function BreakPage() {
  const shortBreakIdeas = [
    'Stretch',
    'Move',
    'Get water',
    'Go to the bathroom',
    'Do some deep breathing'
  ];

  const longBreakIdeas = [
    'Make a snack',
    'Take a short walk',
    'Stretch',
    'Do a dance break',
    'Play with your pup'
  ];

  return (
    <div className="break-container">
      <div className="break-column">
        <div className="break-title">Short Break Ideas</div>
        {shortBreakIdeas.map((idea, index) => (
          <div className="break-item" key={index}>
            {idea}
          </div>
        ))}
      </div>
      <div className="break-column">
        <div className="break-title">Long Break Ideas</div>
        {longBreakIdeas.map((idea, index) => (
          <div className="break-item" key={index}>
            {idea}
          </div>
        ))}
      </div>
    </div>
  );
}

export default BreakPage;
